    "2015-06-19T16:59:41.070882",nt"name": "orthoimagery-morton-county-north-dakota-usa",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains imagery from the
    National Agriculture Imagery Program (NAIP). The NAIP acquires digital ortho imagery
    during the agricultural growing seasons in the continental U.S.. A primary goal
    of the NAIP program is to enable availability of ortho imagery within one year of
    acquisition. NAIP provides two main products: 1 meter ground sample distance (GSD)
    ortho imagery rectified to a horizontal accuracy of within +/- 5 meters of reference
    digital ortho quarter quads (DOQQ's) from the National Digital Ortho Program (NDOP)
    or from the National Agriculture Imagery Program (NAIP); 1 meter GSD ortho imagery
    rectified to within +/- 6 meters to true ground. The tiling format of NAIP imagery
    is based on a 3.75' x 3.75' quarter quadrangle with a 300 meter buffer on all four
    sides. The NAIP imagery is formatted to the UTM coordinate system using the North
    American Datum of 1983 (NAD83). The NAIP imagery may contain as much as 10% cloud
    per tile. This file was generated by compressing NAIP imagery that cover the county
    extent. Two types of compression may be used for NAIP imagery: MrSID and JPEG 2000.
    Target values for the compression ratio are (15:1).",nt"license_title": null,nt"extras":
